// Expected input:
// - msg.payload -> string (text to display on the LED matrix)
//
// This node builds a "led_matrix_print" JSON command for the Python TCP server:
// { "cmd": "led_matrix_print", "text": "<msg.payload>" }
// and appends a newline at the end.

if (typeof msg.payload !== "string") {
    // Try to convert non-string payloads to string
    if (msg.payload === null || msg.payload === undefined) {
        node.error("msg.payload must be a string (text to display)", msg);
        return null;
    }
    msg.payload = String(msg.payload);
}

const cmd = {
    cmd: "led_matrix_print",
    text: msg.payload
};

msg.payload = JSON.stringify(cmd) + "\n";

return msg;
